import './App.css';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import PicComponent from './PicComponent';
import Login from './Login';


const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Login />} />
        <Route path="/register" />
        <Route path="/dashboard" />
      </Routes>
    </Router>
  );
}

export default App;
